import React from "react";

import { IconButton } from "@material-ui/core";
import ClearIcon from "@material-ui/icons/Clear";

export const ClearDriveProjectIcon = ({ drive }) => {
  return (
    <>
      <IconButton>
        <ClearIcon />
      </IconButton>
    </>
  );
};
